import React, { Component, useEffect, useState } from 'react'

export function Crypto(){
        const [crypto, setCrypto] = useState([]);

        useEffect(() => {
            const loadData = () => {
                fetch('http://localhost:8000/api/crypto/')
                    .then(response => response.json())
                    .then(data => setCrypto(data))
            };
            loadData();
        }, []);
};

export class Listcrypto extends Component{
    render(){
        return(
            <div>
                <h1>teste</h1>
                {Crypto.map(crypto => (
                    <h1 key={crypto.id}>{crypto.sigla} {crypto.nome}</h1>
                ))};
            </div>

        );
    }

}
